import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom';

export default function Home() {
    const [users, setUsers] = useState([])
    useEffect(() => {
        loadUsers()
    }, [])
    const loadUsers = async () => {
        const result = await axios.get("http://localhost:8080/api/user")
        setUsers(result.data);
    }
    const handleDelete = async (uid) => {
        await axios.delete(`http://localhost:8080/api/user/delete/${uid}`)
        loadUsers()
    }
    return (
        <div className='container'>
            <div className='py-4'>
            </div><table className="table">
                <thead>
                    <tr>
                        <th scope="col">No</th>
                        <th scope="col">Phone Number</th>
                        <th scope="col">Email</th>
                        <th scope="col">Password</th>
                        <th scope="col">Role</th>
                        <th scope="col">Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        users.map((item, index) => (
                            <tr key={index}>
                                <th scope="row">{index + 1}</th>
                                <td>{item.phoneNumber}</td>
                                <td>{item.email}</td>
                                <td>{item.password}</td>
                                <td>{item.role.id == 1 ? <span class="badge text-bg-primary">{item.role.roleName}</span> : <span class="badge text-bg-primary">{item.role.roleName}</span>}</td>
                                <td>
                                    <Link to={`/edit-user/${item.id}`} href='#' className='btn btn-warning m-2'>Edit</Link>
                                    <button onClick={() => handleDelete(item.id)} className='btn btn-danger'>Delete</button>
                                </td>
                            </tr>
                        ))
                    }
                </tbody>
            </table>
        </div>
    )
}
